import React, { useEffect, useState } from "react";
import axios from "axios";

const QuarterBookingPage = () => {
    const [bookings, setBookings] = useState([]);

    useEffect(() => {
        fetchBookings();
    }, []);

    const fetchBookings = async () => {
        try {
            const response = await axios.get("http://localhost:5000/quarter-bookings");
            setBookings(response.data);
        } catch (error) {
            console.error("Error fetching booking data:", error);
        }
    };

    return (
        <div className="p-4">
            <h2 className="text-2xl font-bold mb-4">Quarter Booking Details</h2>
            <table className="min-w-full bg-white border">
                <thead>
                    <tr>
                        <th className="p-2 border">Booking ID</th>
                        <th className="p-2 border">Faculty Name</th>
                        <th className="p-2 border">Department</th>
                        <th className="p-2 border">Quarters Type</th>
                        <th className="p-2 border">Status</th>
                        <th className="p-2 border">Assigned Quarter</th>
                    </tr>
                </thead>
                <tbody>
                    {bookings.map((booking) => (
                        <tr key={booking.booking_id}>
                            <td className="p-2 border">{booking.booking_id}</td>
                            <td className="p-2 border">{booking.faculty_name}</td>
                            <td className="p-2 border">{booking.department}</td>
                            <td className="p-2 border">{booking.quarters_type}</td>
                            <td className="p-2 border">{booking.status}</td>
                            <td className="p-2 border">{booking.assigned_quarter || "N/A"}</td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
};

export default QuarterBookingPage;
